import React from "react";
import Filters from '../Filters'
import './index.css'
import Card from '../Card'

export default function Cards (props){
    return (
        <div>
            <Filters/>
            <div className="listado">
                <ul>
                  {props.perritos? props.perritos.map(perro => {}): <h1>No hay perritos</h1>}
                </ul>
            </div>
        </div>
    )
}

